  \"2015-01-22T15:57:56.825731\",\n\t\"name\": \"performance-snapshot-reports\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The HOME Program Performance SNAPSHOTs
  are quarterly cumulative performance reports, which can be useful in tracking the
  HOME program progress of participating jurisdictions and in keeping constituents
  more fully informed of the types of activities undertaken with HOME funds. The performance
  SNAPSHOT is an important tool in helping to evaluate the performance of participating
  jurisdictions by providing a context for accomplishments. This performance SNAPSHOT
  measures cumulative program progress through September 30, 2013.  The SNAPSHOTs
  factor in the 2006 allocation amounts. Please note that this will directly affect
  achievement levels in the % of Funds Committed and % of Funds Disbursed categories.\",\n\t\"license_title\":
